import "../Style/Test_Menu.css";
import react, { useState } from "react";

const Test_Menu = () => {
  const [isHovering, setIsHovering] = useState(false);
  const handleMouseOver = () => {
    setIsHovering(true);
  };

  const handleMouseOut = () => {
    setIsHovering(false);
  };
  return (
    <div
      className={
        isHovering ? "tabmenu_div_not_hovering" : "tabmenu_div_hovering"
      }
      onMouseOut={handleMouseOut}
      onMouseOver={handleMouseOver}
    >
      <form className="tabmenu_form">
        <div className="topForm_font_size">
          <ul className="topForm_ul">기타</ul>
        </div>
        <div className="topForm_font_size">
          <ul className="topForm_ul">작</ul>
        </div>
        <div className="topForm_font_size">
          <ul className="topForm_ul">기다란거 테스트</ul>
        </div>
      </form>
      <form
        className={
          isHovering ? "tabmenu_form_not_hovering" : "tabmenu_form_hovering"
        }
      >
        <div className="bottmForm_font_size">
          <ul>1-1</ul>
          <ul>1-2</ul>
          <ul>1-3</ul>
        </div>
        <div className="bottmForm_font_size">
          <ul>2-1</ul>
          <ul>2-2</ul>
          <ul>2-3</ul>
        </div>
        <div className="bottmForm_font_size">
          <ul>3-1</ul>
          <ul>3-2</ul>
          <ul>3-3</ul>
        </div>
      </form>
    </div>
  );
};

export default Test_Menu;
